export type tournamentType = {
    value: string;
    label: string;
}

export const Tournament: Array<tournamentType> = [
    {value: '全豪オープン', label: '全豪オープン'},
    {value: '全仏オープン', label: '全仏オープン'},
    {value: 'ウィンブルドン', label: 'ウィンブルドン'},
    {value: '全米オープン', label: '全米オープン'}
]
